// src/components/ShopPerformance.jsx
import React, { useEffect, useState } from 'react';

const ShopPerformance = () => {
  const [shopData, setShopData] = useState({
    gmv: 0,
    orders: 0,
    unitsSold: 0,
    loading: true,
    error: null,
  });

  // Fetch data from the backend
  useEffect(() => {
    const fetchShopData = async () => {
      try {
        const currentDate = new Date();
        const start = new Date(currentDate.getTime() - 86400 * 1000); // 24 hours ago
        const end = currentDate;

        // Format dates as YYYY-MM-DD
        const formatDate = (date) => {
          const year = date.getFullYear();
          const month = (date.getMonth() + 1).toString().padStart(2, '0');
          const day = date.getDate().toString().padStart(2, '0');
          return `${year}-${month}-${day}`;
        };

        const start_time = formatDate(start);
        const end_time = formatDate(end);
        const page_size = 10;
        const page_no = 1;
        const brand_id = '7496217208817354793';

        // Request data from FastAPI backend
        const response = await fetch(
          `http://localhost:8000/shop/performance?start_time=${start_time}&end_time=${end_time}&page_size=${page_size}&page_no=${page_no}&brand_id=${brand_id}`
        );
        const data = await response.json();

        // Update the state with the fetched data using functional update
        if (data.gmv) {
          setShopData((prevData) => ({
            ...prevData,
            gmv: data.gmv,
            orders: data.orders,
            unitsSold: data.unitsSold,
            loading: false,
          }));
        } else {
          throw new Error('No data returned');
        }
      } catch (error) {
        console.error('Error fetching shop data:', error);
        setShopData((prevData) => ({
          ...prevData,
          loading: false,
          error: error.message,
        }));
      }
    };

    fetchShopData();
  }, []); // Empty dependency array to ensure the effect only runs once

  if (shopData.loading) {
    return <p>Loading...</p>; // Show loading state while data is being fetched
  }

  if (shopData.error) {
    return <p>Error: {shopData.error}</p>; // Display error if fetching fails
  }

  return (
     <div>
      <h2>Shop Performance Overview</h2>

      {/* Parent Card for Daily Performance */}
      <div className="card">
        <h3>Daily Performance</h3>
        <div className="card-data">
          {/* Displaying Cards for GMV, Orders, and Units Sold */}
          <div className="card">
            <h3>Total GMV</h3>
            <div className="card-data">
              <p><strong>GMV:</strong> ${shopData.gmv}</p>
            </div>
          </div>

          <div className="card">
            <h3>Total Orders</h3>
            <div className="card-data">
              <p><strong>Orders:</strong> {shopData.orders}</p>
            </div>
          </div>

          <div className="card">
            <h3>Units Sold</h3>
            <div className="card-data">
              <p><strong>Units Sold:</strong> {shopData.unitsSold}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ShopPerformance;
